    "2015-09-26T22:53:28.260349",nt"name": "nwfsc-observer-trawl-data-off-west-coast-of-us-2002-2006",nt"isopen":
    false,nt"url": null,nt"notes": "Observer Trawl Data collected during 2002-2006
    off West Coast of US.nnThis data product originates from data collected by fishery
    observers in the West Coast Groundfish Observer Program (WCGOP), Fishery Resource
    Analysis and Monitoring Division (FRAM) at the Northwest Fisheries Science Center,
    NOAA Fisheries.  The WCGOP's goal is to improve total catch estimates by collecting
    information on the discarded catch (fish returned overboard at-sea) of west coast
    groundfish species.  All data were collected according to standard protocols and
    data quality control established by the WCGOP.  The observed portion of overall
    catch or landings in a fishery varies by coverage level.  Since all fishing operations
    are not observed, neither the maps nor the data can be used to characterize the
    fishery completely.  This is especially true for rarely-occurring species and when
    observed sample sizes are small.  We urge caution when utilizing these data due
    to the complexity of groundfish management and fleet harvest dynamics.  Grid cells
    representing less than 3 vessels and less than 10 hauls or sets are not shown due
    to confidentiality and to ensure adequate sample size.  In the limited-entry groundfish
    bottom trawl fishery, species discard rates (species discard weight / groundfish
    total catch (discard + retained weight)) are categorized by approximate quartile
    ranges and geo-referenced to 10 x 10 kilometer grid cells.  The observed trawl towline
    (line drawn from the start to end location of a trawl tow) was used to allocate
    data to 10 x 10 kilometer grid cells for calculation.  Seventeen species were represented
    based on combined observer data from 2002-2006.  The species included in this data
    product are dover sole (Microstomus pacificus), sablefish (Anoplopoma fimbria),
    longspine thornyhead (Sebastolobus altivelis), shortspine thornyhead (Sebastolobus
    alascanus), lingcod (Ophiodon elongatus), arrowtooth flounder (Atheresthes stomias),
    English sole (Parophrys vetulus), petrale sole (Eopsetta jordani), and the rockfishes
    (genus Sebastes), darkblotched rockfish (S. crameri), Pacific ocean perch (S. alutus),
    chilipepper (S. goodei), cowcod (S. levis), bocaccio (S. paucispinis), canary rockfish
    (S. pinniger), widow rockfish (S. entomelas), yelloweye rockfish (S. ruberrimus),
    and yellowtail rockfish (S. flavidus).nnPurpose: This data product was developed
    to provide basic groundfish discard distribution information for a wide variety
    of audiences.  The West Coast Groundfish Observer Program conducts sampling of groundfish
    discarded by commercial fisheries along the entire continental U.S. West Coast.
     The seventeen species included in this data product are among those of most interest
    to the fisheries management and commercial fishing communities.nnData Credits: NOAA
    Fisheries, Northwest Fisheries Science Center, Fishery Resource Analysis & Monitoring
    Division, West Coast Groundfish Observer Program, Seattle, WA.",nt"license_title":
